import React, { ReactElement } from "react";
import Blocks from "../Blocks.tsx";

const Customs = (): ReactElement => {
  return (
    <>
      <div className="caption">Choose your set time</div>
      <div className="flex-row center-contents default-div">
        <Blocks margin="0em 20% 0em 20%" text="Short" description="30 second per set" />
        <Blocks margin="0em auto 0em auto" text="Short" description="30 second per set" />
      </div>
      <Blocks text="Short" description="30 second per set" />
    </>
  );
}

export default Customs;
